async function skinUpdate(_id: string, classe: string, picture: string, color: Array<string>, object: Array<string>, favorite: number, creator: string) {
    var data: any = []
    const response = await fetch("http://localhost:4000/skins", {
        method: "PUT",
        body: JSON.stringify({ _id, classe, picture, color, object, favorite, creator})
    });
    data = [await response.status];
    return data
}

export default skinUpdate;
